    global calculate_file_hash
    def calculate_file_hash(filename):
    #     
        hasher = hashlib.md5()

    #     
        with open(filename, 'rb') as file:
        #        
            for chunk in iter(lambda: file.read(4096), b''):
                hasher.update(chunk)

    #      
            return hasher.hexdigest()

    
    def compare_string_with_array(string, array):
        for element in virus_hash:
           if string == element:
              return True
        return False
    def scan(self):
        # ,   ,   
        self.label.setText(": ...") 
        scan_file()
    
    global scan_file
    def scan_file(): 
        folder_path = filedialog.askdirectory()

        if folder_path:
            for files in os.walk(folder_path):
                for file in files:
                    if (file.endswith(".exe") or file.endswith(".py") or file.endswith(".bat")) and ("trojan" in file or "mainer" in file or "CryptoLocker" in file or "Zeus Gameover" in file ):
                        file_path = os.path.join(file)
                    
                        for elemnt in virus_hash: 
                            if calculate_file_hash(file) == elemnt: 
                                f.insert(tk.END, f'System: Virus is detect!{file_path}\nVirus is died!')
                                os.remove(file_path)
                                f.insert(tk.END, f'System:Virus is detect!{file_path}\nVirus is died!')
                                f.delete(tk.END)
                                break 
                
                     
                            else: 
                                file_path = os.path.join(file)
                                f.insert(tk.END, f'\nSystem:Virus not founded\n{file_path}\n')
                                f.delete(tk.END)
                                break
    

